import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

function CourseView() {
  const location = useLocation();
  const navigate = useNavigate();
  const { course } = location.state || {};

  if (!course) {
    return <div>No course data available. Please return to the schedule.</div>;
  }

  return (
    <div>
      <h2>{course.course_name}</h2>
      <p><strong>Course Number:</strong> {course.course_number}</p>
      <p><strong>Section Number:</strong> {course.section_number}</p>
      <p><strong>Instructor:</strong> {course.instructor_name}</p>
      <p><strong>Number of Students:</strong> {course.student_count}</p>
      <p><strong>Credits:</strong> {course.credits}</p>
      <p><strong>Description:</strong> {course.description}</p>
      <p><strong>Modality:</strong> {course.modality}</p>
      <button onClick={() => navigate('/schedule')}>Back to Schedule</button>
    </div>
  );
}

export default CourseView;
